script: |
  super -f text -I q122.spq | sort > q122.out

inputs:
  - name: q122.spq
    data: |
      SELECT ALL + ( - 81 ) FROM tab0 (FORMAT parquet) WHERE NOT NULL IS NULL OR NOT NULL BETWEEN ( col1 ) + - 93 AND - col2 - ( - ( - - col0 ) ) + + - ( col1 ) * - 40 + col0;
  - name: tab0

outputs:
  - name: q122.out
    data: |
